import React from "react";

const Home = () => {
   return(
      <React.Fragment>
        <p class="paragraph">Indelect Technologies Pvt.Ltd. established in the year 1995 by the Technocrats having over 18 years of combined expertise in technology and mentoring experience in advanced areas of Biomedical Engineering, Medical Imaging Technology and Power Electronics</p>     
        <div class="image-container">
         <img src="imaging.jpg" alt="landing-page"></img>
         <img src="zoltan-tasi.jpg" alt="landing-page"></img>
         <img src="xray.jpg" alt="landing-page"></img>
         <img src="table.jpg" alt="landing-page"></img>       
        </div>
      </React.Fragment>
   )
};  
export default Home;
